import React from 'react';
function App(){
    return(
        <div>
            <p>React is a js library for building user interface</p>
            <ul>
                <li>Components</li>
                <li>JSX</li>
                <li>Virtual DOM</li>
            </ul>
        </div>
    );
}
export default App;
